import keyMirror from "keymirror";

export default keyMirror({
  CUSTOMER: null,
  ON_FORM_FIELD_CHANGE: null,
  CUSTOMER_SUCCESS: null,
  CUSTOMER_REQUEST: null,
  CUSTOMER_ERROR: null,
});
